column8:
プロレーサーシリーズ人気ナンバー1のタイプZZ！性能を一切低下させることなく最適な排気レイアウトを導き出し、車種別にテール形状を変化させ、厳格なJASMA基準もクリアしています。薄型オールステンレスボディーを採用し、軽量かつ中高速域でのトルクアップをぜひ体感してください。  <br><br>●メインパイプ：SUS436（1.2mm厚）オールステンレス  ●パイプ径：60.5パイ→70パイ ●サイレンサー径：100パイ ●JASMA認定品 ※テールエンド形状はそれぞれ砲弾タイプ/スタンダードタイプ(タイコ型)と車種により異なります。 <br><br>  <br><br>対応車種：GH-GDB インプレッサ H17/6～ EJ20(T/C)  <br><br>　車検対応品 <br><br>排気系/マフラー<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


