レース用マフラーの性能をストリートレベルにフィードバック。ストリートという分野で必要とされる中低速でのトルクをできるだけ確保し、高回転でのパワー・レスポンスを実現させたパワーレデューサー＆内燃機構造の採用により、音量はインナーサイレンサー無しでJASMA基準に適合。ストリートで要求される高回転域でのパワーをより求めた為、音量はJASMA基準ギリギリレベル。JASMA基準（平成10年度）に適合しているので、安心してストリートで柿本改ならではのレーシーなサウンドを思う存分楽しんで頂ける。 <br>●材質:オールステンレス ●パイプ径（パイ）80/タイコ径（パイ）152/テール径（パイ）115 ●出口:S(左) 【納期】お取り寄せ商品のため通常3～4日でのお届けとなります。(日・祝日は除く)万が一欠品の場合は別途メールにてご連絡差し上げます。お急ぎの場合はご注文前に必ず納期確認を頂きますようお願い申し上げます。<br>【注意】●リアピースのみ <br>対応車種：02/11～07/6 GDA(M/C後) インプレッサWRX (C/D/E/F/G) エンジン型式：EJ20(T) <br>　保安基準適合品<br>排気系/マフラー<br>※送料は地域や配達場所によって変わりますが、6000円～12000円程度が目安となります。<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


