サーキットの鼓動がストリートにこだまするプロ仕様の排気システム。オールステンレスのボディーとテールエンドには「インコネル」（ニッケル素材の超耐熱合金）を採用。中高速域を重視したパイプレイアウトと爽快な抜けの良い高音域のエキゾーストが最大の特徴です。もちろんJASMA認定車検対応品。  <br><br>●メインパイプ素材：SUS436（1.2mm厚）オールステンレス  ●テールエンド素材：SUS304＆インコネル600 ●パイプ径：70パイ ●サイレンサー径：150パイ→100パイ(170) ●JASMA認定品 <br><br>  <br><br>H15/6～ TA-BL5 レガシィ B4 EJ20(T/C)  <br><br>　車検対応品 <br><br>排気系/マフラー<tr><td colspan="2">
