スタイリッシュ/スポーツをテーマに車のデザインを引き立てるフォルムを演出。車種別に専用設計を行い、パフォーマンスをアップ。オールステンレス製、バフ仕上げによる高級感と耐久性を両立。大型サイレンサーを採用し快適性を損なわない心地よいサウンドとローダウン時のロードクリアランスを確保。 <br>テールエンド部にチタニウム素材独特のヒートグラデーションを採用。安心のJASMA認定マフラーです。text by safe<br>テール：115x2パイ　メインパイプ：60x2パイ　分割数：2　音量：85/83db　材質：オールステンレス製 <br>対応車種：UA/CBA/DBA-BLE レガシィ B4 <br>　車検対応品<br>排気系/マフラー<tr><td colspan="2">
